import {FaShoppingCart} from "react-icons/fa"


const Navbar = () => {
  return (<div>
    <div className="flex flex-row justify-between ">
    <img src="https://www.google.com/url?sa=i&url=https%3A%2F%2Fwww.vecteezy.com%2Ffree-vector%2Fcoding-logo&psig=AOvVaw3lgmYFsDq7pjNuWUVGPPjc&ust=1704697947930000&source=images&cd=vfe&opi=89978449&ved=0CBIQjRxqFwoTCPiB4IDdyoMDFQAAAAAdAAAAABAD"/>
     <div>
     <p>Home</p>
      <FaShoppingCart/>
     </div>
    </div>
  </div>)
};

export default Navbar;
